# Steps to reproduce the problem
Run following code

  const frame = document.createElement('iframe');
  document.body.appendChild(frame);
  frame.src = 'about:blank';
  let doc = frame.contentDocument;
  doc.open('text/html', 'replace'); 
  doc.write('FOO');
  doc.close();

  frame.src = 'about:blank';
  doc = frame.contentDocument;
  doc.open('text/html'); 
  doc.write('BAR');
  doc.close();

expect to see "BAR" in iframe contents
see nothing in iframe contents

# Problem Description
My application uses code described above to init iframe and start rendering in it with javascript. It used to work in v112 (I did not try to find exact version when it got broken). And it did work for past 6+ years. In the v123 it is broken.

# Summary
Regression with code that inits iframe.

